const Colors = {
    primary: '#dee2e6',
    secondary: '#cb997e',
    lightGreen: '#a5a58d',
    offright: '#ffe8d6',
    lightBrown: '#ddbea9',
    lightGray: '#ced4da',
    white: '#f8f9fa'
}

export default Colors;
